        LongestSubstringWithoutRepeatingCharacters functionUnderTest
                = new LongestSubstringWithoutRepeatingCharactersMySlidingWindow();

        String s1 = "abcabcbb";
        System.out.println("Output for " + s1 + " is: " + functionUnderTest.lengthOfLongestSubstring(s1));

        String s2 = "bbbbb";
        System.out.println("Output for " + s2 + " is: " + functionUnderTest.lengthOfLongestSubstring(s2));

